import "./style.css";

function Todo() {
  return (
    <>
      <div className="todo">
        <h2>리액트 공부하기</h2>
        <span>리액트 기초를 공부해봅시다</span>
        <div className="btn">
          <button className="btn1">삭제하기</button>
          <button className="btn2">완료</button>
        </div>
      </div>
    </>
  );
}
